import React from 'react';
import DBArticles from '../DBArticles';
function SavedArticles(props) {
return (
    <div className="row">
    <div className="col-lg-12">
      <div className="panel panel-primary">
        <div className="panel-heading">
          <h3 className="panel-title">
            <strong>
              <i className="fa fa-newspaper-o" aria-hidden="true"></i> Saved Articles
            </strong>
          </h3>
        </div>
        <div className="panel-body">
          <DBArticles articles={props.articles}
                    handleDeleteButton = {props.handleDeleteEvent}
          />
        </div>
      </div>
    </div>
  </div>
    )
};
export default SavedArticles;
